import React from "react";
import SvgIssueOpened from "../SVG/SvgIssueOpened";
const Status = ({state}) =>{
    if(state === 'open')
    return(
        <span className={info.state + ' icon'} aria-label={info.state + ' issue'}>
            <SvgIssueOpened />
        </span>
    );
    else return <span>ok</span>
}
export default Status;
